import React, { useContext, useState } from 'react';
import { TextInput, TouchableOpacity, StyleSheet, View, Text } from 'react-native';


export default function SignUp({ route }) {

    return (
        <View style={styles.container}>
            <TextInput
                style={styles.textInput}
                placeholder="Name"
            />
            <TextInput
                style={styles.textInput}
                placeholder="E-Mail"
            />
            <TextInput
                style={styles.textInput}
                placeholder="Password"
            />
            <TextInput
                style={styles.textInput}
                placeholder="Alter"
            />
            <TextInput
                style={styles.textInput}
                placeholder="Begrenzungen/Krankheiten"
            />
            <TextInput
                style={styles.textInput}
                placeholder="Vorlieben"
            />
            <TextInput
                style={styles.textInput}
                placeholder="Ziele"
            />

            <Text style={styles.text1} >Forgotten Password?</Text>
            <TouchableOpacity
                style={styles.button}
            >
                <Text style={styles.text2}>LOG IN</Text>
            </TouchableOpacity>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        color: 'white',
        alignItems: 'center',
        justifyContent: 'center',
    },
    image: {
        width: 30,
        height: 30
    },

    button: {
        backgroundColor: 'deepskyblue',
        alignItems: 'center',
        justifyContent: 'center',
        paddingHorizontal: 5,
        paddingVertical: 10,
        width: 200,
        margin: 3,
        // borderRadius: 0,
        // borderWidth: 2,
        // borderColor: 'dimgray'

    },

    textInput: {
        //fontFamily: 'cursive',
        color: 'black',
        fontSize: 16,
        //fontWeight: "bold"
        alignItems: 'center',
        justifyContent: 'center',
        paddingHorizontal: 5,
        paddingVertical: 10,
        width: 300,
        margin: 3,
        borderRadius: 0,
        borderWidth: 2,
        borderColor: 'black'

    },
    text1: {
        //fontFamily: 'cursive',
        color: 'deepskyblue',
        fontSize: 16,
        // fontWeight: "bold"

    },

    text2: {
        //fontFamily: 'cursive',
        color: 'white',
        fontSize: 16,
        fontWeight: "bold"

    },
});
